import React from "react";
import { Menu, Segment, Container, Grid, Header } from "semantic-ui-react";

export default () => {
  return (
    <div style={{ position: "" }}>
      <Segment
        inverted
        style={{
          margin: "",
          padding: "20px 0 0 0",
          position: "absolute",
          width: "100%",
          height: "30%",
          bottom: "0",
        }}
        vertical
      >
        <Container>
          <Grid columns={2} stackable inverted divided>
            <Grid.Row>
              <Grid.Column floated="left" width={6}>
                <Header inverted as="h4" content="About" />
                <p>This is a Identity Management project</p>
              </Grid.Column>
              <Grid.Column floated="right" width={3}>
                <Header inverted as="h4" content="Quick Links" />
              </Grid.Column>
            </Grid.Row>
          </Grid>
        </Container>
      </Segment>
    </div>
  );
};
